import { Card } from "./Card";
import "./Content.css";

export default function Content({ searchResult, onChoice }) {
  // console.log(data);

  return (
    <div className="content-box glass ">
      {searchResult?.map((el) => (
        <Card animeData={el} key={el?.title} />
      ))}
    </div>
  );
}
